import React,{useState} from 'react'

const User = () => {
    
const [login, setLogin] = useState()


    return (
        <div className="container text-center">
     
            {
            login==1?<h1>User 1</h1>
            :login==2?<h1>User 2</h1>
            :login==3?<h1>User 3</h1>
            :<h1>Guest User</h1>
            }
        </div>
    )
}

export default User
